Spring Data MongoDb elemMatch criteria matching all search strings<p>I'm having an issue with custom Spring Data queries with MongoDb and Java.  I'm attempting to implement a flexible search functionality against most of the fields of the document.<br />
This document represents a person, and it contains a set of addresses embedded in it; the address has a field that is a set of strings that are the 'street address lines'.</p>
<p>I started with Query By Example, and this works for the single fields. but doesn't work for other types - such as this set of strings.  For these, I'm building custom criteria.</p>
<p>The search criteria includes a set of street lines that I would like to match against the document's lines.  If every line in the search is found in the document, the criteria should be considered matching.</p>
<p>I've tried using elemMatch, but this doesn't quite work like I want:</p>
<pre><code>    addressCriteriaList.add(Criteria.where(&quot;streetAddressLines&quot;).elemMatch(new Criteria().in(addressSearch.getStreetAddressLines())));

</code></pre>
<p>This seems to match if only ONE line in the document matches the search.  If I have the following document:</p>
<pre><code>&quot;streetAddressLines&quot;: [ &quot;123 Main Street&quot;, &quot;Apt 1&quot; ]
</code></pre>
<p>and the search looks like this:</p>
<pre><code>&quot;streetAddressLines&quot;: [ &quot;123 Main Street&quot;, &quot;Apt 2&quot; ]
</code></pre>
<p>the elemMatch succeeds, but that's not what i want.</p>
<p>I've also tried looping through each of the search lines, trying an elemMatch to see if each is in the document:</p>
<pre><code>var addressLinesCriteriaList = new Array&lt;Criteria&gt;();
var streetAddressLines = address.getStreetAddressLines();
streetAddressLines.forEach(l -&gt;  addressLinesCriteriaList.add(Criteria.where(&quot;streetAddressLines&quot;).elemMatch(new Criteria().is(l))))

var matchCriteria = new Criteria.andOperator(addressLinesCriteriaList);
</code></pre>
<p>This doesn't seem to work.  I have done some experimenting, and it may be that this doesn't seem to work:  new Criteria().is(l)</p>
<p>I tried this, and this DOES seem to work, but I would think that it's really inefficient to create a collection for each search line:</p>
<pre><code>        streetAddressLines.forEach(l -&gt;
                {
                    var list = new ArrayList&lt;String&gt;();
                    list.add(l);
                    addressCriteriaList.add(Criteria.where(&quot;streetAddressLines&quot;).elemMatch(new Criteria().in(l)));
                });
</code></pre>
<p>So I don't know exactly what's going on - does anyone have any ideas of what I'm doing wrong?  Thanks in advance.</p>

