Rename database field within array in MongoDB<p>I need to change a few database fields in my backend controller before returning the object to the frontend.</p>
<p>Currently, I am doing it in the front end like this with my returned object:</p>
<pre><code>       for (let contribution of contributions) {
          contribution[&quot;title&quot;] = &quot;You Added One&quot;
          contribution[&quot;launchName&quot;] = contribution.name
          contribution[&quot;launchId&quot;] = contribution._id
          contribution[&quot;date&quot;] = contribution.addedAt
          contribution[&quot;content&quot;] = contribution.description
        }
</code></pre>
<p>But I am now trying to do this work in the backend using Mongo.</p>
<p>This is my controller:</p>
<pre><code>const Launch = require('../models/launch')
const User = require('../models/user')
async function getRecentActivityByUserId (req, res) {
  const { userId } = req.params

  const user = await User.findOne({ userId }).lean() || []

  const contributions = await Launch.find({ _id: { $in: user.contributions } })

  return res.status(200).send(contributions.reverse())
}
</code></pre>
<p>So this correctly returns an object to the frontend but I still need to change the database field names.</p>
<p>So I tried this:</p>
<pre><code>async function getRecentActivityByUserId (req, res) {
  let recents = []
  const { userId } = req.params

  const user = await User.findOne({ userId }).lean() || []

  const contributions = await Launch.find({ _id: { $in: user.contributions } }).aggregate([
    {
        $addFields: {
            plans: {
                $map:{
                    input: &quot;$launch&quot;,
                    as: &quot;l&quot;,
                    in: {
                        title: &quot;You Added One&quot;,
                        launchName: &quot;$$l.name&quot;,
                        launchId: &quot;$$l._id&quot;,
                        date: &quot;$$l.addedAt&quot;,
                        content: &quot;$$l.description&quot;,
                    }
                }
            }
        }
    },
    {
        $out: &quot;launch&quot;
    }
])

  return res.status(200).send(contributions.reverse())
}
</code></pre>
<p>The above throws an error saying that I <code>.aggregrate</code> is not a function on <code>.find</code>. Even if I remove the <code>.find</code>, the object returned is just an empty array so I'm obviously not aggregating correctly.</p>
<p>How can I combine <code>.find</code> with <code>.aggregate</code> and what is wrong with my <code>.aggregate</code> function??</p>
<p>I also tried combining aggregate with find like this and get the error <code>Arguments must be aggregate pipeline operators</code>:</p>
<pre><code>  const contributions = await Launch.aggregate([
    {
      $match: {
      _id: { $in: user.contributions }
      },
        $addFields: {
            plans: {
                $map:{
                    input: &quot;$launch&quot;,
                    as: &quot;l&quot;,
                    in: {
                        title: &quot;You Added a Kayak Launch&quot;,
                        launchName: &quot;$$l.name&quot;,
                        launchId: &quot;$$l._id&quot;,
                        date: &quot;$$l.addedAt&quot;,
                        content: &quot;$$l.description&quot;,
                    }
                }
            }
        }
    },
    {
        $out: &quot;launch&quot;
    }
])
</code></pre>
<p>EDIT: Just realized that I have the word <code>plans</code> in the aggregate function and that is not relevant to my code. I copied this code from elsewhere so not sure what the value should be.</p>

